"use strict";(self.webpackChunkjohnycho_dev=self.webpackChunkjohnycho_dev||[]).push([[4194],{1222:a=>{a.exports=JSON.parse('{"tag":{"label":"JPA","permalink":"/docs/tags/jpa","description":"JPA tag description","allTagsPath":"/docs/tags","count":9,"items":[{"id":"spring-framework/spring-transactional-aop","title":"@Transactional \uc5b4\ub178\ud14c\uc774\uc158 AOP \ub3d9\uc791 \ud750\ub984","description":"@Transactional \uc5b4\ub178\ud14c\uc774\uc158\uc744 \uc0ac\uc6a9\ud55c \uc120\uc5b8\uc801 \ud2b8\ub79c\uc7ad\uc158 \uad00\ub9ac(Declarative Transaction Management)\uc758 \uc804\uccb4 \ud750\ub984\uc5d0\ub294 \ud06c\uac8c 3\uac00\uc9c0 \uc694\uc18c\uac00 \ub4f1\uc7a5\ud569\ub2c8\ub2e4. \ud2b8\ub79c\uc7ad\uc158 \ub9e4\ub2c8\uc800, \ud2b8\ub79c\uc7ad\uc158 AOP \ud504\ub85d\uc2dc, \ud2b8\ub79c\uc7ad\uc158 \ub3d9\uae30\ud654 \ub9e4\ub2c8\uc800\uac00 \uc774\uc5d0 \ud574\ub2f9\ub429\ub2c8\ub2e4.","permalink":"/docs/spring-framework/spring-transactional-aop"},{"id":"spring-data-jpa/jpa-ddl-auto","title":"ddl-auto \uc635\uc158","description":"ddl-auto \uc635\uc158\uc740 \uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc5d0\uc11c Hibernate\uc640 \uac19\uc740 JPA \uad6c\ud604\uccb4\ub97c \uc0ac\uc6a9\ud560 \ub54c \ub370\uc774\ud130\ubca0\uc774\uc2a4 \uc2a4\ud0a4\ub9c8 \uad00\ub9ac\ub97c \uc81c\uc5b4\ud558\ub294 \uc124\uc815\uc785\ub2c8\ub2e4.","permalink":"/docs/spring-data-jpa/jpa-ddl-auto"},{"id":"spring-data-jpa/jpa-id-generation-strategy","title":"ID \uc0dd\uc131 \uc804\ub7b5","description":"JPA\uc5d0\uc11c ID\ub97c \uc0dd\uc131\ud558\uae30 \uc704\ud574\uc11c\ub294 \uc9c1\uc811 \ud560\ub2f9\uacfc \uc790\ub3d9 \ud560\ub2f9\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc9c1\uc811 \ud560\ub2f9\uc740 @Id\uc5b4\ub178\ud14c\uc774\uc158\ub9cc\uc744 \uc0ac\uc6a9\ud558\uc5ec Id\uac12\uc744 \uc9c1\uc811 \ud560\ub2f9\ud558\ub294 \ubc29\uc2dd\uc785\ub2c8\ub2e4. \ubc18\uba74, \uc790\ub3d9","permalink":"/docs/spring-data-jpa/jpa-id-generation-strategy"},{"id":"spring-data-jpa/jpa-fetch-join-paging","title":"JPA Fetch Join\uacfc \ud398\uc774\uc9d5\uc744 \ud568\uaed8 \uc0ac\uc6a9\ud560 \ub54c \uc8fc\uc758\uc810","description":"~ToMany \uad00\uacc4\uc5d0\uc11c Fetch Join\uacfc \ud398\uc774\uc9d5\uc744 \ud568\uaed8 \uc0ac\uc6a9\ud558\uba74 OutOfMemoryError\uac00 \ubc1c\uc0dd\ud560 \uc218 \uc788\ub2e4\ub294 \uc810\uc744 \uc8fc\uc758\ud574\uc57c \ud569\ub2c8\ub2e4. \uc608\ub97c \ub4e4\uc5b4, \uc544\ub798\uc640 \uac19\uc774 Product(1)-ProductCategory(N) \uad00\uacc4\uac00 \uc788\uc744 \ub54c, ProductJpaRepository\uc758 findProductWithSlice\ucc98\ub7fc Fetch Join\uacfc \ud398\uc774\uc9d5\uc744 \ud568\uaed8 \uc0ac\uc6a9\ud558\ub294 \uacbd\uc6b0\uc5d0 OOM\uc774 \ubc1c\uc0dd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/spring-data-jpa/jpa-fetch-join-paging"},{"id":"spring-data-jpa/jpa-n+1-problem","title":"N + 1 \ubb38\uc81c","description":"\uc5f0\uad00 \uad00\uacc4\uac00 \uc124\uc815\ub41c \uc5d4\ud2f0\ud2f0\ub97c \uc870\ud68c\ud560 \uacbd\uc6b0\uc5d0, \uc870\ud68c\ub41c \ub370\uc774\ud130 \uac1c\uc218(N)\ub9cc\ud07c \uc5f0\uad00\uad00\uacc4\uc758 \uc870\ud68c \ucffc\ub9ac\uac00 \ucd94\uac00\ub85c \ubc1c\uc0dd\ud558\ub294 \ud604\uc0c1\uc785\ub2c8\ub2e4. \uc608\ub97c \ub4e4\uc5b4, \ube14\ub85c\uadf8 \uac8c\uc2dc\uae00\uacfc \ub313\uae00\uc774 \uc788\ub294 \uacbd\uc6b0,","permalink":"/docs/spring-data-jpa/jpa-n+1-problem"},{"id":"spring-data-jpa/jpa-one-to-one-lazy-loading","title":"OneToOne \uc5f0\uad00\uad00\uacc4 Lazy Loading \ubb38\uc81c","description":"\uc591\ubc29\ud5a5 @OneToOne\uc77c \ub54c \uc5f0\uad00\uad00\uacc4\uc758 \uc8fc\uc778\uc774 \uc544\ub2cc \uc5d4\ud2f0\ud2f0\ub97c \uc870\ud68c\ud560 \uacbd\uc6b0 Lazy Loading\uc774 \ub3d9\uc791\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.","permalink":"/docs/spring-data-jpa/jpa-one-to-one-lazy-loading"},{"id":"spring-framework/spring-osiv","title":"OSIV(Open Session In View) \uc635\uc158","description":"OSIV(open session in view) \ub294 \uc601\uc18d\uc131 \ucee8\ud14d\uc2a4\ud2b8\ub97c \ubdf0\uae4c\uc9c0 \uc5f4\uc5b4 \ub454\ub2e4\ub294 \uc758\ubbf8\uc785\ub2c8\ub2e4. \uc601\uc18d\uc131 \ucee8\ud14d\uc2a4\ud2b8\uac00 \uc0b4\uc544\uc788\uc73c\uba74 \uc5d4\ud2f0\ud2f0\ub294 \uc601\uc18d \uc0c1\ud0dc\ub85c \uc720\uc9c0\ub420 \uc218 \uc788\uc5b4, \ubdf0\uc5d0\uc11c\ub3c4 \uc9c0\uc5f0 \ub85c\ub529\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc5b4\uc694. OSIV\uc758 \ud575\uc2ec\uc740 \ubdf0\uc5d0\uc11c\ub3c4 \uc9c0\uc5f0 \ub85c\ub529\uc774 \uac00\ub2a5\ud558\ub3c4\ub85d \ud558\ub294 \uac83\uc785\ub2c8\ub2e4. \uac00\uc7a5 \ub2e8\uc21c\ud55c \uad6c\ud604\uc740 \ud074\ub77c\uc774\uc5b8\ud2b8 \uc694\uccad\uc774 \ub4e4\uc5b4\uc62c\ub54c \ud544\ud130\ub098 \uc778\ud130\uc149\ud130\uc5d0\uc11c \ud2b8\ub79c\uc7ad\uc158\uc744 \uc2dc\uc791\ud558\ub294 \ubc29\ubc95\uc778\ub370\uc694. \uc774\ub97c \ud2b8\ub79c\uc7ad\uc158 \ubc29\uc2dd OSIV\ub77c\uace0 \ud569\ub2c8\ub2e4. \ud558\uc9c0\ub9cc, \ud2b8\ub79c\uc7ad\uc158 \ubc29\uc2dd OSIV\ub294 \ud45c\ud604 \uacc4\uce35\uc5d0\uc11c\ub3c4 \uc5d4\ud2f0\ud2f0\ub97c \uc218\uc815\ud560 \uc218 \uc788\uae30 \ub54c\ubb38\uc5d0 \uc720\uc9c0\ubcf4\uc218\ud558\uae30 \uc5b4\ub824\uc6b4 \ucf54\ub4dc\ub97c \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/spring-framework/spring-osiv"},{"id":"spring-data-jpa/jpa-new-entity","title":"\uc0c8\ub85c\uc6b4 Entity \ud310\ub2e8 \uae30\uc900","description":"\u2714\ufe0f JPA\uc5d0\uc11c \uc0c8\ub85c\uc6b4 Entity\uc778\uc9c0 \ud310\ub2e8\ud558\ub294 \ubc29\ubc95\uc740 \ubb34\uc5c7\uc77c\uae4c?","permalink":"/docs/spring-data-jpa/jpa-new-entity"},{"id":"spring-data-jpa/jpa-entity-manager","title":"\uc5d4\ud2f0\ud2f0 \ub9e4\ub2c8\uc800(Entity Manager)","description":"\uc5d4\ud2f0\ud2f0 \ub9e4\ub2c8\uc800\uc5d0 \ub300\ud574 \uc54c\uae30 \uc704\ud574\uc120 \uc601\uc18d\uc131 \ucee8\ud14d\uc2a4\ud2b8\uc5d0 \ub300\ud574 \uc54c\uc544\uc57c \ud569\ub2c8\ub2e4.","permalink":"/docs/spring-data-jpa/jpa-entity-manager"}],"unlisted":false}}')}}]);